import PropTypes from 'prop-types';

const AppLayout = ({childern}) => {
    return (
     <div>
        <div>공통 메뉴</div>
        {childern}
     </div>   
    );
};

AppLayout.propTypes = {
    childern: PropTypes.node.isRequired,
};

export default AppLayout;
